import { Table } from "../Table/Table";
import {TableHeader} from "../TableHeader/TableHeader";
import {UserData} from '../UserData/UserData'
export const Account = () => {
    return (
        <Table>
        <TableHeader
          headers={[
            "Дата операции",
            "Пользователь",
            "Номер операции",
            "Поступило",
            "Списано",
          ]}
        />
        <UserData
          data={[
            "Дата операции",
            "Пользователь",
            "Номер операции",
            "Поступило",
            "Списано",
          ]}
        />
      </Table>
    )
}
